/**
 * 에러 페이지
 */
 import styled from 'styled-components';
 const NotFoundBlock = styled.div`
 position: fixed;
 width: 100%;
 height: 100%;
 background: white;
 


`;
const Box = styled.div`
position: absolute;
  left: 0;
  top: 0;
  bottom: 0;
  right: 0;
  background: ${palette.gray[2]};
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;


`
 const EditPostPage = () => {
   
   return (
   <NotFoundBlock>      
    <Box></Box>
   </NotFoundBlock>);
 };
 
 export default EditPostPage;
